import Foundation
protocol GoogleVisionDelegate {
    func GoogleVisionFound(googleVisionResult: [GoogleVisionResult])
    func GoogleVisionNotFound()
}

class GoogleVisionAPIManager{
    var delegate: GoogleVisionDelegate?
    var googleAPIKey = "AIzaSyDylWQa_5KfJ0GQ71I1ZxLLXdp2Hpo_lpY"
    var googleURL: URL {
        return URL(string: "https://vision.googleapis.com/v1/images:annotate?key=\(googleAPIKey)")!
    }
    
    //this function parses the JSON using CodableI
    func fetchGoogleVisionUsingCodable(with imageBase64: String) {
        

        var request = URLRequest(url: googleURL)
        request.httpMethod = "POST"
        request.addValue("application/json", forHTTPHeaderField: "Content-Type")
        request.addValue(Bundle.main.bundleIdentifier ?? "", forHTTPHeaderField: "X-Ios-Bundle-Identifier")
        print("About to build request")
        // Build our API request

        let jsonRequest = [
            "requests": [
                "image": [
                    "content": " "
                ],
                "features": [
                    [
                        "type": "LABEL_DETECTION",
                        "maxResults": 10
                    ]
                ]
            ]
        ]

      let jsonData = try? JSONSerialization.data(withJSONObject: jsonRequest, options: .prettyPrinted)
        request.httpBody = jsonData
        let task = URLSession.shared.dataTask(with: request) { (data, response, error) in
            print("In task")
            //check for valid response with 200 (success)
            guard let response = response as? HTTPURLResponse, response.statusCode == 200 else {
                self.delegate?.GoogleVisionNotFound()
                print("Not found 1")
                
                return
            }
            
            //ensure data is non-nil
            guard let data = data else {
                self.delegate?.GoogleVisionNotFound()
                print("Not found 2")
                return
            }
            
            //print the response
            let str = String(data: data, encoding: .utf8)
              print(str)
            
            let decoder = JSONDecoder()
            let decodedRoot = try? decoder.decode(Json4Swift_Base.self, from: data)
  
            //ensure json structure matches our expections and contains a venues array
            guard let root = decodedRoot else {
                print("NOT FOUND")
                self.delegate?.GoogleVisionNotFound()
                return
            }
            
            let descriptions = (decodedRoot?.responses!)?.labelAnnotations?.description
            var googleVisionResults = [GoogleVisionResult]()
            for description in descriptions! {
                let googleVisionResult = GoogleVisionResult(name: description)
                googleVisionResults.append(googleVisionResult)
                print(description)
            }
            self.delegate?.GoogleVisionFound(googleVisionResult: googleVisionResults)
            
        }
        
        task.resume()
    }
        
}

